import React from 'react';

export default function About() {
	return (
		<div className="text-center">
			<h1>About</h1>
			<p>This is todo list app version 1.0.0</p>

		<p>
Hi! We are the team behind the todo list website. 
We created this website to help people keep track of their to-do lists and get things done!
we lov people get their lives organized. We offer a variety of to-do list tools to help people manage their tasks and get things done. We are committed to helping people lead more productive and organized lives. </p>
		</div>
	)
}
